import React from 'react'
import  ButtonCSS from "./Btn.module.css";

interface Properties{
  message : String[];
}

function Btn(properties: Properties ) {
  return (
    <div>
        <button className={ButtonCSS.btn}>properties.message</button>
    </div>
  )
}

export default Btn
